import {GoogleLogout} from 'react-google-login';
const clientId = " 14356892946-l0rlcjia1lddo3n891bhbpeoavotrphr";

function Logout() {
    const onSuccess = ()=>{
        console.log("Logout Successful !");
    }
    return(
        <div>
            <GoogleLogout
            clientId = {clientId}
            buttonText = "Logout"
            onLogoutSuccess = {onSuccess}
            />
        </div>
    )
}
export default Logout;
